Audio &amp; Motion - Elektronica 10 (21-08-2010) 

The 10th of a weekly series by the up and coming Audio &amp; Motion, a special 100 minute episode with some of the best tracks of 2010. Follow Audio &amp; Motion on Facebook for updates, previous episodes, streaming, and download links.



Facebook Page:

Track List Available At: http://AudioAndMotion.com/elektronica/episode10.php


1. Deadmau5 - Some Chords
2. Tiesto, Diplo - C'mon
3. Pendulum - The Island Part I
4. Dirtyloud - Dirtymind
5. Pryda - Niton
6. Ashley Wallbridge - Smoke
7. Dash Berlin - To Be The One (Cressida Remix)
8. DJ Butterfly - Dust In The Aid (Dave202 Remix)
9. Markus Schulz - Perception (Super8 &amp; Tab Remix)
10. Nadia Ali - FAntasy (Tritonal Air Up There Remix)
11. Sophie Sugar, Sunlounger - Lost Together (Armin van Buuren Mash Up)
12. Robert Nickson - Never Again (Nitrous Oxide Remix)
13. Max Graham, Ana Criado - Nothing Else Matters (Aly &amp; Fila Remix)
14. Tiesto - Feel it In My Bones (PAul Miller &amp; Sasha Dubrovsky vs. Suncatcher Remix)
15. Dave202 - Arrival (Sabastian Brandt Remix)
16. Cosmic Gate - London Rain (Suspect 44 Remix)


